// contracts/AIModelMarketplace.sol
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract AIModelMarketplace {
    struct Model {
        string name;
        string description;
        uint256 price;
        address payable creator;
        uint8 totalRatings;
        uint8 numOfRatings;
        bool purchased;
    }

    Model[] public models;
    mapping(uint256 => address[]) public modelPurchasers;

    address public owner;

    constructor() {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Not the contract owner");
        _;
    }

    modifier onlyPurchasers(uint256 modelId) {
        bool hasPurchased = false;
        for (uint256 i = 0; i < modelPurchasers[modelId].length; i++) {
            if (modelPurchasers[modelId][i] == msg.sender) {
                hasPurchased = true;
                break;
            }
        }
        require(hasPurchased, "You must purchase the model to rate it");
        _;
    }

    // List a new AI model
    function listModel(string memory name, string memory description, uint256 price) public {
        require(price > 0, "Price must be greater than zero");

        Model memory newModel = Model({
            name: name,
            description: description,
            price: price,
            creator: payable(msg.sender),
            totalRatings: 0,
            numOfRatings: 0,
            purchased: false
        });

        models.push(newModel);
    }

    // Purchase an AI model
    function purchaseModel(uint256 modelId) public payable {
        require(modelId < models.length, "Model does not exist");
        Model storage model = models[modelId];
        require(msg.value >= model.price, "Insufficient funds to purchase the model");
        require(model.purchased == false, "Model already purchased");

        model.creator.transfer(msg.value); // Transfer payment to the model creator
        modelPurchasers[modelId].push(msg.sender);
        model.purchased = true;
    }

    // Rate a purchased model
    function rateModel(uint256 modelId, uint8 rating) public onlyPurchasers(modelId) {
        require(modelId < models.length, "Model does not exist");
        require(rating >= 1 && rating <= 5, "Rating should be between 1 and 5");

        Model storage model = models[modelId];
        model.totalRatings += rating;
        model.numOfRatings++;
    }

    // Withdraw accumulated funds
    function withdrawFunds() public onlyOwner {
        uint256 balance = address(this).balance;
        require(balance > 0, "No funds available to withdraw");
        payable(owner).transfer(balance);
    }

    // Get model details
    function getModelDetails(uint256 modelId) public view returns (string memory, string memory, uint256, address, uint8) {
        require(modelId < models.length, "Model does not exist");

        Model memory model = models[modelId];
        uint8 averageRating = model.numOfRatings == 0 ? 0 : model.totalRatings / model.numOfRatings;

        return (model.name, model.description, model.price, model.creator, averageRating);
    }
}
